import axios from "axios";

const API_URL = "http://localhost:5000/api/auth"

export const login = async (email:string,password:string)=>{
    return axios.post(API_URL + "/signup",{
        email,
        password,
    }).then((response)=>{
        console.log(response,"response");
        return response;
    });
}
